import React from "react";

function HomePage() {
  return (
    <React.Fragment>
      <div
        style={{
          backgroundImage: "url(images/LandingImage.png)",
          height: "100vh",
        }}
      >
        {/* <img
          src="images/LandingImage.png"
          alt="Medic"
          style={{ height: "100vh", width: "100%" }}
        ></img> */}
        <img
          src="https://i.pinimg.com/originals/09/8a/78/098a78706d066533ee5a3fb19094f963.gif"
          alt="loading..."
          style={{ height: "40vh", paddingTop: "100px" }}
        />
        <img
          src="https://images.squarespace-cdn.com/content/v1/5b23e822f79392038cbd486c/1529521231626-ZPUF3P5JME3QDUQRNCQA/ke17ZwdGBToddI8pDm48kBtpJ0h6oTA_T7DonTC8zFdZw-zPPgdn4jUwVcJE1ZvWQUxwkmyExglNqGp0IvTJZamWLI2zvYWH8K3-s_4yszcp2ryTI0HqTOaaUohrI8PIFuiOGcl3CiyaoGv1LFK6C-uVTB72DAj8xeCvdUFb7SY/Medication+gif+for+endometriosis"
          alt="loading..."
          style={{ height: "40vh", paddingTop: "100px" }}
        />
      </div>
    </React.Fragment>
  );
}

export default HomePage;
